#
# TABLE STRUCTURE FOR: author
#

DROP TABLE IF EXISTS `author`;

CREATE TABLE `author` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `age` varchar(255) DEFAULT 'Unknown',
  `gender` varchar(255) NOT NULL,
  `email` varchar(255) DEFAULT 'Unknown',
  `contact` varchar(255) DEFAULT 'Unknown',
  `bio` varchar(255) DEFAULT 'Not Available',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



#
# TABLE STRUCTURE FOR: book
#

DROP TABLE IF EXISTS `book`;

CREATE TABLE `book` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `author_fk_id` int(255) NOT NULL,
  `publisher_fk_id` int(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `price` int(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `author_fk_id` (`author_fk_id`,`publisher_fk_id`),
  KEY `publisher_fk_id` (`publisher_fk_id`),
  CONSTRAINT `book_ibfk_1` FOREIGN KEY (`publisher_fk_id`) REFERENCES `publisher` (`id`),
  CONSTRAINT `book_ibfk_2` FOREIGN KEY (`author_fk_id`) REFERENCES `author` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



#
# TABLE STRUCTURE FOR: book_issue
#

DROP TABLE IF EXISTS `book_issue`;

CREATE TABLE `book_issue` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `book_fk_id` int(255) NOT NULL,
  `member_fk_id` int(255) NOT NULL,
  `issue_date` date NOT NULL DEFAULT current_timestamp(),
  `due_date` date DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `book_fk_id` (`book_fk_id`,`member_fk_id`),
  KEY `member_fk_id` (`member_fk_id`),
  CONSTRAINT `book_issue_ibfk_1` FOREIGN KEY (`book_fk_id`) REFERENCES `book` (`id`),
  CONSTRAINT `book_issue_ibfk_2` FOREIGN KEY (`member_fk_id`) REFERENCES `member` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



#
# TABLE STRUCTURE FOR: member
#

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



#
# TABLE STRUCTURE FOR: publisher
#

DROP TABLE IF EXISTS `publisher`;

CREATE TABLE `publisher` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



